description:
Hey whats up guys! Korang tahu tak, yang sekarang korang dah boleh dapatkan Nutella Biscuits di mana-mana supermarkets seluruh negara! Sangat sedap untuk snacking dengan kawan-kawan dan family. Ada 14 biji biskut dalam satu pek untuk dikongsi bersama. 

Kat bahagian luar ada lapisan biskut yang rangup dan kat dalam pula ada Nutella spread yang sedap. Perfect combo! Jadi cepat dapatkan Nutella Biscuits sekarang dan kongsi bersama yang tersayang. 😁

